import React from 'react';
import {
	LeftArticleArrowOpacity,
	RightArticleArrowOpacity,
} from 'components/common/ArticleArrowsOpacity';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import Slider from 'react-slick';
import ArticleEmployment from 'components/common/ArticleEmployment';

function FeaturePosition({ title, data }) {
	// const settings = {
	// 	dots: false,
	// 	infinite: false,
	// 	speed: 600,
	// 	slidesToShow: 4,
	// 	slidesToScroll: 4,
	// 	nextArrow: <RightArticleArrowOpacity />,
	// 	prevArrow: <LeftArticleArrowOpacity />,
	// 	arrows: true,
	// };

	return (
		<ComponentsWrapper>
			<header className="titlelist-header">
				<div className="titlelist-title-wrapper">
					<h2 className="titlelist-title">
						<Link to="/wdlist">{title}</Link>
					</h2>
				</div>
				<div>
					<button type="button" className="btn-right" disabled>
						<span>
							<svg viewBox="0 0 18 18">
								<path d="m6.045 9 5.978-5.977a.563.563 0 1 0-.796-.796L4.852 8.602a.562.562 0 0 0 0 .796l6.375 6.375a.563.563 0 0 0 .796-.796L6.045 9z" />
							</svg>
						</span>
					</button>
					<button type="button" className="btn-right">
						<span>
							<svg viewBox="0 0 18 18">
								<path d="m11.955 9-5.978 5.977a.563.563 0 0 0 .796.796l6.375-6.375a.563.563 0 0 0 0-.796L6.773 2.227a.562.562 0 1 0-.796.796L11.955 9z" />
							</svg>
						</span>
					</button>
				</div>
			</header>
			<ul>
				<li>
					<ArticleEmployment />
					<ArticleEmployment />
					<ArticleEmployment />
					<ArticleEmployment />
				</li>
			</ul>
		</ComponentsWrapper>
	);
}

const ComponentsWrapper = styled.div`
	position: relative;
	margin-bottom: -70px;
	> ul {
		margin: -10px;
		padding: 0;
		display: flex;
	}
	> ul li {
		width: 25%;
		padding: 10px;
		list-style: none;
		display: inline-block;
		vertical-align: top;
	}
	.titlelist-header {
		position: relative;
		margin-bottom: 40px;
	}
	.titlelist-title-wrapper {
		display: flex;
		flex-direction: column;
		justify-content: center;
		height: 51px;
		padding-top: 36px;
	}
	.titlelist-title {
		display: flex;
		justify-content: center;
		align-items: center;
		margin-bottom: 9px;
		font-size: 22px;
		font-weight: 700;
		color: #333;
		text-align: center;
		> span {
			font-weight: 400;
		}
		> a > img {
			position: relative;
			top: 3px;
			width: 24px;
			height: 24px;
			margin: 0 8px 0 4px;
		}
	}
	.titlelist-button-container {
		display: flex;
		align-items: center;
		justify-content: center;
		width: 100%;
		> a > span:first-child {
			padding-top: 2px;
			margin-right: 6px;
			font-style: normal;
			font-weight: 500;
			font-size: 15px;
			line-height: 18px;
			color: #767676;
		}
		> a {
			display: flex;
			align-items: center;
			justify-content: center;
		}
		.btn-right {
			width: 6px;
			height: 10px;
			padding: 0;
			margin: 0;
			color: #767676;
			> svg {
				position: absolute;
				width: inherit;
				height: inherit;
				color: inherit;
			}
		}
	}
`;

const CustomSlider = styled(Slider)`
	z-index: 1;
	position: relative;
	display: block;
	box-sizing: border-box;
	user-select: none;
	touch-action: pan-y;
	padding-top: 70px;
	top: -100px;
	overflow-x: hidden;

	.slick-slide {
		float: left;
		height: 100%;
		min-height: 1px;
		display: inline-block;
	}
`;

export default FeaturePosition;
